import React from 'react'
import logo from '../img/header/logo.svg'
import headerPage from '../img/header/fon.png'
import './header.css'


const Header = () => {
  return (
    <header className='header'>
        <a href="/" className="logo"><img src={logo} alt="logo" /></a>
    </header>
  )
}

export default Header
